import { useState } from "react";


const Checkbox = () => {
  const [isChecked, setIsChecked] = useState(true);

  return (
    <div>
      <label htmlFor="check">
        チェック：
      </label>
      <input
        type="checkbox"
        id="check"
        checked={isChecked}
        onChange={() => setIsChecked(prevState => !prevState)}
      />
      <div>{isChecked ? "チェックあり" : "チェックなし"}</div>
    </div>
  );
};

export default Checkbox;
